/*
Stop tomcat.
Log into mysql (e.g. using the command line interface or MysQL Workbench) and 
run the script createOpenmrsminimallabs.sql
The hard-coded values below are the values for my database. They may or may not be the same for yours.
*/
SET foreign_key_checks = 0;

/*
SET @MAXCONCEPTID := 165173;
SET @MAXCONCEPTANSWERID := 7258;
SET @MAXCONCEPTDESCID := 18161;
SET @MAXCONCEPTNAMEID := 143860;
SET @MAXCONCEPTSOURCEID := 39;
