*/
SET @MAXCONCEPTID := (select max(concept_id) from openmrs.concept);
SET @MAXCONCEPTANSWERID := (select max(concept_answer_id) from openmrs.concept_answer);
SET @MAXCONCEPTDESCID := (select max(concept_description_id) from openmrs.concept_description);
SET @MAXCONCEPTNAMEID := (select max(concept_name_id) from openmrs.concept_name);
SET @MAXCONCEPTSOURCEID := (select max(concept_source_id) from openmrs.concept_reference_source);
SET @MAXCONCEPTSETID := (select max(concept_set_id) from openmrs.concept_set);
SET @MAXIMPORTEDITEMID := (select max(imported_item_id) from openmrs.metadatasharing_imported_item);
SET @MAXIMPORTEDPACKAGEID := (select max(imported_package_id) from openmrs.metadatasharing_imported_package);

update openmrsminimallabs.concept set concept_id = concept_id + @MAXCONCEPTID where concept_id >= 45;
update openmrsminimallabs.concept_numeric set concept_id = concept_id + @MAXCONCEPTID where concept_id >= 45;
update openmrsminimallabs.concept_answer set concept_answer_id = concept_answer_id + @MAXCONCEPTANSWERID, concept_id = concept_id + @MAXCONCEPTID where concept_answer_id >= 11;
update openmrsminimallabs.concept_description set concept_description_id = concept_description_id + @MAXCONCEPTDESCID, concept_id = concept_id + @MAXCONCEPTID where concept_description_id >= 40;
update openmrsminimallabs.concept_name set concept_name_id = concept_name_id + @MAXCONCEPTNAMEID, concept_id = concept_id + @MAXCONCEPTID where concept_name_id >= 272;
update openmrsminimallabs.concept_reference_source set concept_source_id = @MAXCONCEPTSOURCEID + concept_source_id where concept_source_id > 11;
-- concept_reference_term_id and concept_map_id seem to be OK, no overlap
update openmrsminimallabs.concept_reference_term set concept_source_id = @MAXCONCEPTSOURCEID + concept_source_id;
update openmrsminimallabs.concept_reference_map set concept_id = concept_id + @MAXCONCEPTID;
update openmrsminimallabs.concept_set set concept_set_id = @MAXCONCEPTSETID + concept_set_id, concept_id = concept_id + @MAXCONCEPTID, concept_set = @MAXCONCEPTID + concept_set;
update openmrsminimallabs.metadatasharing_imported_item set imported_item_id = @MAXIMPORTEDITEMID + imported_item_id;
update openmrsminimallabs.metadatasharing_imported_package set imported_package_id = @MAXIMPORTEDPACKAGEID + imported_package_id;
-- this last item may fail if you've already tried importing lab_orderables before. 

-- concept_name seems to have a lot of duplicates already, so I am ignoring near-matches that have different UUIDs.
-- concept_reference_source should really not have duplicates; deduplicate with values already in openmrs
SET @SNOMEDCT := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'SNOMED CT');
SET @SNOMEDNP := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'SNOMED NP');
SET @LOINC := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'LOINC');
SET @PIH := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'PIH');
SET @PIHM := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'PIH Malawi');
SET @AMPATH := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'AMPATH');
SET @org := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'org.openmrs.module.mdrtb');
SET @CIEL := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'CIEL');
SET @IMO := (select concept_source_id from openmrs.concept_reference_source WHERE name = 'IMO ProcedureIT');

UPDATE openmrsminimallabs.concept_reference_term set concept_source_id = @LOINC WHERE concept_source_id = 11;
UPDATE openmrsminimallabs.concept_reference_source set concept_source_id = @LOINC WHERE concept_source_id = 11;
UPDATE openmrsminimallabs.concept_reference_term set concept_source_id = @SNOMEDCT WHERE concept_source_id = 10;
UPDATE openmrsminimallabs.concept_reference_source set concept_source_id = @SNOMEDCT WHERE concept_source_id = 10;
